import p1 from "./1.jpeg.webp";
import p2 from "./2.jpeg.webp";
import p3 from "./3.jpeg.webp";
import p4 from "./4.jpeg.webp";

let data_product = [
  {
    id:1,
    brand: "Apple",
    name: "iPhone 15 Pro Max",
    image:p1,
    new_price:125000,
    old_price:140000,
},
{
    id:2,
    brand: "Google",
    name: "Google Pixel",
    image:p2,
    new_price: 50000,
    old_price:90000,
},
{
    id:3,
    brand: "Nothing",
    name: "Nothing phone 2",
    image:p3,
    new_price:39999,
    old_price: 45000,

},
{
    id:4,
    brand: "Samsung",
    name: "Samsung Galaxy S23 FE",
    image:p4,
    new_price: 105000,
    old_price:140000,
},
];

export default data_product;
